import { useState } from "react";

interface ResultProps {
    list: Restaurant[];
}

export interface Restaurant {
    id: string,
    name: string,
    location: {
        address1: string;
    };
    distance: number;
    url: string;
    }


    const Result: React.FC<ResultProps> = ({ list }) => {
        const [currentIndex, setCurrentIndex] = useState(0);

        const handleNext = () => {
            setCurrentIndex(prevIndex => prevIndex + 1);
        };

        const handlePrev = () => {
            setCurrentIndex(prevIndex => prevIndex - 1);
        };

        const restaurant = list[currentIndex];

        return (
            <div>
                <table>
                    <thead>
                        <tr>
                            <th>Name</th>
                            <th>Address</th>
                            <th>Distance (meters)</th>
                            <th>Yelp Link</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr key={restaurant.id}>
                            <td>{restaurant.name}</td>
                            <td>{restaurant.location.address1}</td>
                            <td>{restaurant.distance.toFixed(1)}</td>
                            <td><a href={restaurant.url}>{restaurant.name}</a></td>
                        </tr>
                    </tbody>
                </table>
                <button onClick={handlePrev} disabled={currentIndex === 0}>Previous</button>
                <button onClick={handleNext} disabled={currentIndex === list.length - 1}>Next</button>
            </div>
        );
    }

    export default Result;
